import React, { Component } from 'react'
import { Link } from 'react-router-dom'

class HomeComponent extends Component {
    render() {
        //  Matc.params must match whatever parameter was given in route
        return <div>Welcome {this.props.match.params.userName}. You can view the latest jobs <Link to="/jobs">here.</Link></div>
    }
}

export default HomeComponent
